Hey queens, 
Please tag @hudabeautyshop if you liked this look. 
First of all I’d like to thank each one of you kind souls who showed so much love on my last post. It’s so incredible that sometimes it feels unbelievable. Also, I am so happy today!!!! Can you believe @undiscovered_muas reposted my picture? I AM ON THEIR FEED♥️😍. Coming back to the tutorial , I used mostly my hands specially to do my base makeup. I’ve used only cream products and I only did spot powdering to set around certain areas that were too shiny. I learnt this technique from @danessa_myricks and it’s been a game changer for me. I hope you all try this and love it as much as I do. Love you angels. Music credits: Tere jeha hor disda by @nupurpant .
.
